webpackJsonp([0xf6d98473b9f7],{1099:function(e,a){e.exports={data:{markdownRemark:{html:'<p>For this month’s <a href="https://awsmprompts.wordpress.com/2015/03/09/march-prompt-create-some-game-based-learning/" title="Create Some Game-Based Learning">AWSM Prompt</a>, I am creating a game-based module, based on the really cool <a href="http://www.edheads.org/activities/eng_cell/" title="EdHeads: Design a Cell Phone">EdHeads Design a Cell Phone game</a>. I didn’t realize that March had advanced so far! I hope I can finish it before the month is up. I hope to add an animation of the main avatar, Rae, using After Effects so that she can move her mouth and shuffle a bit. Enjoy this GIF while I continue designing. What are you designing this month?</p>\n<figure>\n  <img src="/FitopolyApp-d31e967a0eb899b5dd6c9b243afcff06.gif" alt="Fitopoly app functionality">\n</figure>',frontmatter:{date:"March 19, 2015",path:"/blog/awsm-prompt-2-in-progress",title:"AWSM Prompt 2: In Progress",tags:["design","game","serious game","Storyline"],categories:["AWSM Prompts","Design","elearning","Showing my Work"],featured:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1.768172888015717,src:"/static/logoColor-c92143fb3723fcd5f12c0d0502759756-81d39.png",srcSet:"/static/logoColor-c92143fb3723fcd5f12c0d0502759756-9a8d1.png 203w,\n/static/logoColor-c92143fb3723fcd5f12c0d0502759756-c53f9.png 405w,\n/static/logoColor-c92143fb3723fcd5f12c0d0502759756-81d39.png 810w,\n/static/logoColor-c92143fb3723fcd5f12c0d0502759756-e81a9.png 900w",sizes:"(max-width: 810px) 100vw, 810px"}}}}}},pathContext:{}}}});
